import React from 'react';


export class Hamburger extends React.Component{
    state = {
        isHidden: true
    }

    toggleHidden = () => {
        this.setState({
            isHidden: !this.state.isHidden
        })
    }

    render() {
        return (
            <div>
            <div className="hamburger-menu">
                <div className="line"></div>
                <div className="line"></div>
                <div className="line"></div>
            </div>
            <div className="menu">
                <p>About</p>
                <p>Email</p>
                <p>Landing Pages</p>
                <p>Animation</p>
            </div>
            </div>
        )
    }
}
